import React from "react";
import { Button, Box, Typography } from "@mui/material";
import { useNavigate } from "react-router-dom";

const Home: React.FC = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem("authToken"); // Remove a autenticação
    navigate("/login"); // Redireciona para login
  };

  return (
    <Box textAlign="center" p={4}
      sx={{
        background: '#1E1E1E',
        minHeight: '100vh',
        color: '#ffffff',
        border: '1px solid #E3E3E3'
      }}>
      <Typography variant="h4">Bem-vindo ao Atlas Endêmico</Typography>
      <Box sx={{ height: '1000px', width: '100%', border: '1px solid #E3E3E3', paddingTop: '100px' }}>
        <Typography variant="h4" textAlign={"left"}>Dashboard</Typography>
      </Box>
      <Button variant="contained" color="error" onClick={handleLogout}>
        Sair
      </Button>
    </Box>
  );
};

export default Home;
